        if char == '+':
            return 1
        if char == '-':
            return -1
        if char == '<':
            self.index -= 1
            return -1
        if char == '>':
            self.index += 1
            return 1
        if char == '.':
            return self.data[self.index]
        if char == ',':
            self.data[self.index] = ord(self.input[0])
            self.input = self.input[1:]
            return 0
        return 0

    def execute(self, commands):
        charList = re.findall('<[<+>]*>', commands)
        for char in charList:
            self.getChar(char)
        return self.data


