        '-': lambda m: m - 1,
        '.': lambda m: chr(m),
        '[': lambda m: '<' if m < 0 else '>' if m > 255 else m,
        ']': lambda m: '>' if m < 0 else '<' if m > 255 else m,
        '[<+>-]': lambda m: 0 if m == 0 else (1 if m == 1 else -1),
        '[<->-]': lambda m: 0 if m == 0 else (1 if m == 1 else -1)
    }

    mem = [0] * 30000
    ptr = 0
    out = []

    for i in nums:
        if 0 <= i <= 255:
            mem[ptr] = i
        else:
            print('Invalid input', i)
        ptr += cmds[stdin[i]]
        if ptr > len(mem):
            ptr = ptr - len(mem)
        elif ptr < 0:
            ptr = len(mem) + ptr
        if ptr == len(mem):
            out.append('+' * len(mem))
        elif ptr == 0:
            out.append('-' * len(mem))
        else:
            out.append('>' * (ptr - len(mem)) + '[' + '>' * (len(mem) - ptr) + ']' + '<' * (len(mem) - ptr))

    return '\n'.join(out)



