    N, T_1, T_N = map(int, stdin.split())
    def clock_cycle(T):
        while T > 0:
            T -= 1
            yield 1
        while T < 0:
            T += 1
            yield -1

    def clock_position(t, N):
        clock = 0
        for i in clock_cycle(t):
            clock += i
            if clock >= N:
                clock -= N
                return i
        return 0

    return clock_position(T_1, N) + clock_position(T_N, N)


