    """
    解説
    dp[i][j] は i番目以降を食べて j 分程度満足できるか
    dp[i][j] = dp[i - 1][j] or dp[i - 1][j - A[i]]

    何でも良いことにもあるので、最初に、i番目を食べることができるかどうかを判定して
    dp[i][j] = j >= A[i] より、初めて食べることができるかどうかを判定することができる
    """
    N, *A, B, C = map(int, stdin.split())

    dp = [[0] * (B + C) for _ in range(N + 1)]
    dp[0][0] = 0

    for i in range(1, N + 1):
        for j in range(B + C):
            if j >= A[i - 1]:
                dp[i][j] = max(dp[i][j], dp[i - 1][j])
            if j >= A[i - 1] - C:
                dp[i][j] = max(dp[i][j], dp[i - 1][j - C] + B)
            if j >= A[i - 1] + C:
                dp[i][j] = max(dp[i][j], dp[i - 1][j - A[i - 1]] + B + C)

    return dp[-1][-1]

