class TrieNode:
    '''A node in a trie'''

    def __init__(self):
        self.children = {}
        self.indices = set()

    def add(self, prefix: str, index: int) -> None:
        '''Adds the given prefix and index to the node'''
        self.children[prefix[-1]].add(prefix, index)

    def search(self, prefix: str) -> Tuple[bool, Set[int]]:
        '''Returns whether the prefix exists in the node and the indices of all sequences'''
        if not prefix:
            return True, self.indices

        if prefix[0] not in self.children:
            return False, set()

        return self.children[prefix[0]].search(prefix[1:])

    def __str__(self):
        return '\n'.join(f'{prefix} → {index}' for prefix, index in self.children.items())


class Trie:
    '''A trie storing all possible prefixes and their indices'''

    def __init__(self):
        self.root = TrieNode()

    def add(self, prefix: str, index: int) -> None:
        '''Adds the given prefix and index to the trie'''
        node = self.root
        for c in prefix:
            if c not in node.children:
                node.children[c] = TrieNode()
            node = node.children[c]
        node.indices.add(index)

    def search(self, prefix: str) -> Tuple[bool, Set[int]]:
        '''Returns whether the prefix exists in the trie and the indices of all sequences'''
        node = self.root
        for c in prefix:
            if c not in node.children:
                return False, set()
            node = node.children[c]
        return True, node.indices


