def solution(stdin: str) -> str:
    '''
    Time complexity: O(N^2)
    Space complexity: O(N)
    '''
    def is_valid(row, col, N, M, grid):
        # Is within boundaries
        if row < 0 or row >= N or col < 0 or col >= M:
            return False
        # Is empty
        if grid[row][col] == ".":
            return False
        return True

    N, M = [int(x) for x in stdin.split()]
    grid = []
    for _ in range(N):
        grid.append(stdin.split()[0])
        stdin = stdin[stdin.index("\n") + 1:]

    # Get the total number of stars
    total = 0
    for row in grid:
        total += row.count("*")
    if total > N * M:
        return "-1"

    # BFS to find the distances from each star to the nearest empty space
    distances = [[-1] * M for _ in range(N)]
    queue = [(0, 0)]
    for i, row in enumerate(grid):
        for j, char in enumerate(row):
            if char == ".":
                distances[i][j] = 0
                queue.append((i, j))
    while len(queue) > 0:
        row, col = queue.pop(0)
        for dr, dc in zip([-1, 1, 0, 0], [0, 0, -1, 1]):
            if is_valid(row + dr, col + dc, N, M, grid):
                if distances[row][col] == -1 or distances[row + dr][col + dc] > distances[row][col] + 1:
                    distances[row + dr][col + dc] = distances[row][col] + 1
                    queue.append((row + dr, col + dc))

    # See if there's a star with the same distance to every empty space
    for row in range(N):
        for col in range(M):
            if distances[row][col] == distances[row][col - 1] and distances[row][col] == distances[row][col + 1]:
                return "-1"
            if distances[row][col] == distances[row - 1][col] and distances[row][col] == distances[row + 1][col]:
                return "-1"

    # Get the positions of the stars
    positions = []
    for row in range(N):
        for col in range(M):
            if distances[row][col] == distances[row][col - 1] and distances[row][col] == distances[row][col + 1]:
                positions.append((row, col, distances[row][col]))
            if distances[row][col] == distances[row - 1][col] and distances[row][col] == distances[row + 1][col]:
                positions.append((row, col, distances[row][col]))

    # Sort the positions by their distance from the empty space
    positions.sort(key=lambda x: x[2])

    # Now we have a unique list of positions
    seen = {}
    for pos in positions:
        if pos[2] in seen:
            return "-1"
        else:
            seen[pos[2]] = 1

    # Convert the star positions to indices
    stars = [[-1] * 2 for _ in range(len(positions))]
    for i, (row, col, _) in enumerate(positions):
        stars[i][0] = row
        stars[i][1] = col

    # Write the output
    output = ""
    for i in range(len(positions)):
        output += str(stars[i][0]) + " " + str(stars[i][1]) + " " + str(positions[i][2]) + "\n"

    return output



