class UnionFind:
    """Union-find."""

    def __init__(self, size: int) -> None:
        """Initialize the UnionFind."""
        self.parents = [None] * size
        self.ranks = [None] * size
        for i in range(size):
            self.parents[i] = i
            self.ranks[i] = 0

    def find(self, x: int) -> int:
        """Find the root of a component."""
        if self.parents[x] == x:
            return x
        else:
            return self.find(self.parents[x])

    def union(self, x: int, y: int, w: int) -> None:
        """Union the components of vertices x and y with w."""
        root_x = self.find(x)
        root_y = self.find(y)
        if root_x!= root_y:
            if self.ranks[root_x] > self.ranks[root_y]:
                self.parents[root_y] = root_x
                self.ranks[root_x] += self.ranks[root_y]
            else:
                self.parents[root_x] = root_y
                self.ranks[root_y] += self.ranks[root_x]

    def component_size(self, x: int) -> int:
        """Get the size of the component of the vertex x."""
        return self.ranks[self.find(x)]

    def __str__(self) -> str:
        """String representation of the UnionFind."""
        return " ".join(
            [
                f"{self.parents[i]} {i} {self.ranks[i]}"
                for i in range(len(self.parents))
            ]
        )


