def solution(stdin: str) -> str:
    """
    The brute force approach is to check every number in every step,
    and then perform the operations in the order they are performed.
    In each step, there are three operations:
    - divide the current number by 2
    - divide the current number by 3
    - divide the current number by 5

    This approach takes O(N * log(max(A_i))) time complexity,
    where N is the number of integers and max(A_i) is the maximum integer on the board.
    """
    N = int(stdin)
    A = list(map(int, stdin.split()))
    cache = {}
    cnt = 0

    for num in A:
        while num > 1:
            if num % 2 == 0:
                cnt += 1
                num //= 2
            elif num % 3 == 0:
                cnt += 1
                num //= 3
            elif num % 5 == 0:
                cnt += 1
                num //= 5
            else:
                cnt = -1
                break
        cache[num] = cnt

    # Now, let's just use the cache to find the answer
    cnt = 0
    for num, val in cache.items():
        if val!= -1:
            cnt = max(cnt, val)
    return str(cnt)

