def solution(stdin: str) -> str:
    """Returns the earliest possible time we can reach Station N if we are at Station i,
    ignoring the time needed to change trains.

    :param stdin: standard input
    :return: string of the earliest possible time we can reach Station N if we are at Station i
    """
    n = int(stdin.readline())
    arr = [tuple(map(int, line.split())) for line in stdin]
    s = arr[0][1]
    f = arr[0][2]

    if n == 1:
        return str(s)

    # Step 1: Compute the remainder modulo f
    remainders = [s % f]
    for i in range(1, n):
        remainders.append(arr[i][0] % arr[i][2])

    # Step 2: Find the index of the first remainder that is equal to 0
    # Now we have the remainder modulo f for all the indices from 1 to n-1
    # Let's iterate backwards starting from n-2
    for i in range(n - 1, 0, -1):
        if remainders[i] == 0:
            # We found the index, return it
            return str(s + i * f)

