    # Словарь с расстояниями между дистрибутивностями
    dist = {}
    for i in range(n):
        for j in range(n):
            if i!= j:
                dist[(i, j)] = roads[i][j]

    # Словарь с последовательностью дистрибутивностей
    seq = {}
    for route in routes:
        seq[route[0]] = route[1]
    seq[route[1]] = route[0]

    # Решение задачи Командного комплекса
    # Обход всех дистрибутивностей в глубину
    # Начальная дистрибутивность = 1
    stack = [1]
    # Пока стек не пустой
    # Добавление в стек всех соседей дистрибутивности
    while stack:
        next_stack = []
        while stack:
            cur_dist = stack.pop()
            for neighbour in seq[cur_dist]:
                if neighbour not in dist:
                    next_stack.append(neighbour)
                elif neighbour not in stack:
                    stack.append(neighbour)
        stack = next_stack

    # Поиск минимального значения всех соседей
    total_cost = 0
    for cur_dist in stack:
