    def make_prime_factors(n):
        d = {}
        i = 2
        while i * i <= n:
            if n % i:
                i += 1
            else:
                n //= i
                d[i] = d.get(i, 0) + 1
        if n > 1:
            d[n] = d.get(n, 0) + 1
        return d

    def is_prime(n):
        return len(make_prime_factors(n)) == 1

    def is_perfect(n):
        return sum(make_prime_factors(n).values()) == 4

    def is_valid(n):
        return is_prime(n) and is_perfect(n)

    return 'AC' if is_valid(int(stdin)) else 'TLE'

