    def get_front(row):
        for i, el in enumerate(row):
            if el == '1':
                return i
        return len(row)

    def get_back(row):
        for i in range(len(row)-1, -1, -1):
            if row[i] == '1':
                return i
        return -1

    first = stdin[0].split()
    second = stdin[1].split()
    T = int(stdin[2])

    row_size = len(first)

    # Get first front
    first_front = get_front(first)
    # Get second front
    second_front = get_front(second)

    # If the ant has already arrived at the end
    if first_front == len(first) - 1:
        return first

    if second_front == len(second) - 1:
        return second

    # Time to get the first row in front
    first_time = 0
    while first_time < T:
        if first_front < row_size - 1:
            first_front += 1
            first_time += 1
        else:
            break

    # Time to get the second row in front
    second_time = 0
    while second_time < T:
        if second_front < row_size - 1:
            second_front += 1
            second_time += 1
        else:
            break

    # Last iteration
    last_time = 0
    while last_time < T:
        if first_front == get_back(first) and second_front == get_back(second):
            # First ant in first row
            first[first_front] = second[first_front]
            # Second ant in second row
            second[second_front] = first[second_front]
            first_front += 1
            second_front += 1
            last_time += 1
        elif first_front == get_back(first) and second_front < row_size - 1:
            # First ant in first row
            first[first_front] = second[second_front]
            # Second ant in second row
            second[second_front] = first[first_front]
            first_front += 1
            second_front += 1
            last_time += 1
        elif first_front < row_size - 1 and second_front == get_back(second):
            # First ant in first row
            first[first_front] = second[second_front]
            # Second ant in second row
            second[second_front] = first[first_front]
            first_front += 1
            second_front += 1
            last_time += 1
        else:
            break

    return ''.join(first + second)

