def solution(stdin: str) -> str:
    """Takes the user's input and finds the number of stars they want. Then, it goes through each line
    updating the number of stars and printing out the number of stars for each pattern, then the pattern itself.

    Complexity:
    O(n^2) where n is the length of stdin

    Arguments:
        stdin {str} -- the user's input

    Returns:
        str -- the number of stars and the pattern
    """
    stars = int(stdin)
    possible_patterns = {}

    for i in range(1, stars + 1):
        for j in range(1, stars + 1):
            if i + j > stars:
                continue
            if i < j:
                if i == j:
                    if i in possible_patterns:
                        possible_patterns[i]["count"] += 1
                        possible_patterns[i]["stars"].append(i)
                    else:
                        possible_patterns[i] = {"count": 1, "stars": [i]}
                else:
                    if i + j in possible_patterns:
                        possible_patterns[i + j]["count"] += 1
                        possible_patterns[i + j]["stars"].append(i)
                    else:
                        possible_patterns[i + j] = {"count": 1, "stars": [i]}

    possible_patterns = [pattern for pattern in possible_patterns.values()]

    possible_patterns.sort(key=lambda pattern: (pattern["count"], pattern["stars"][0]))

    for pattern in possible_patterns:
        stars = pattern["stars"][0]
        for i in range(1, stars + 1):
            print(str(pattern["stars"][i]) + "," + str(stars - i), end=": ")
            print(str(pattern["stars"][0]) + "," + str(stars - pattern["stars"][i]))

    return "OK"

